import React from 'react';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import './styles/header.css'; // Import the CSS file
import { Button } from '@mui/material';

function Header() {
  return (
    <AppBar position="static" className="app_header"
		sx={{backgroundColor: "var(--primary-color-dark)"}}>
      <Box display="flex" justifyContent="center">
        <Toolbar sx={{width: '70vw'}}>
          <Button variant='contained' className='app_header_button' >
          <Typography className="app_header_name" variant="h6"
            sx={{fontFamily: "var(--font-family-ibm-plex-mono)"}}>
            Nelson
          </Typography>
          </Button>
        </Toolbar>
      </Box>
    </AppBar>
  );
}

export default Header;
